import { useAuth0 } from '@auth0/auth0-react';

function LandingScreen(){
    const navigate = useNavigate();
    const {
        isAuthenticated,
        loginWithRedirect,
      } = useAuth0();

      if (isAuthenticated) {
        navigate('/home')
     }
    return (
        <>
        <button onClick={loginWithRedirect}>Log in</button>
        </>
    );
}

export default LandingScreen;
